INSERT INTO `fs_product_translations` (`id`, `product_id`, `locale`, `name`, `description`, `detail`) VALUES
(1, 2, 'vi', 'Nokia N900', '<ul class=\"item_list\" style=\"padding-left: 15px; margin: 0px;\">\r\n<li>Điện thoại truyền th&ocirc;ng đa phương tiện</li>\r\n<li>Camera 5.0 MP, Camera phụ VGA</li>\r\n<li>Kết nối mạng 3.5G với tốc độ l&ecirc;n đến 10 Mbps</li>\r\n<li>Hỗ trợ A-GPS, OVI Maps</li>\r\n<li>Kết nối Wifi tốc độ cao, Bluetooth, USB</li>\r\n<li>Document viewer (Word, Excel, PowerPoint, PDF)</li>\r\n<li>Chỉnh sửa h&igrave;nh ảnh</li>\r\n<li>Adobe Flash Player 9.4</li>\r\n<li>Out Tivi, v&agrave; jack loa 3.5 mm </li>\r\n</ul>', NULL),
(2, 4, 'vi', 'Nokia 6700 classic gold', '<ul class=\"item_list\" style=\"padding-left: 15px; margin: 0px;\">\r\n<li>Điện thoại 3G với thiết kế thời trang với vỏ tr&aacute;ng 18 carat v&agrave;ng sang trọng</li>\r\n<li>Camera 5 MP, hỗ trợ flash, tự động lấy n&eacute;t</li>\r\n<li>Nghe nhạc/xem phim nhiều định dạng MP3/M4A/AAC/eAAC+/WMA</li>\r\n<li>Đ&agrave;i FM, Bluetooth, kết nối 3.5G với tốc độ truyền dữ liệu 10 Mbps</li>\r\n<li>Định vị GPS, Bản đồ Nokia</li>\r\n<li>Flash Lite 3 </li>\r\n</ul>', NULL),
(3, 5, 'vi', 'Nokia N97', '<ul class=\"item_list\" style=\"padding-left: 15px; margin: 0px;\">\r\n<li>Kiểu trượt cảm ứng s&agrave;nh điệu</li>\r\n<li>Camera 5 MP, camera phụ thực hiện videocall</li>\r\n<li>Bộ nhớ 32 GB, RAM 128 MB</li>\r\n<li>Chức năng định vị GPS</li>\r\n<li>Chức năng Out-Tivi, jack tai nghe 3.5mm</li>\r\n<li>Pocket Office (Word, Excel, PowerPoint, PDF viewer)</li>\r\n<li>Chỉnh sửa h&igrave;nh ảnh v&agrave; Video</li>\r\n<li>Flash Lite 3</li>\r\n<li>Kết nối 3G, Wifi, Bluetooth </li>\r\n</ul>', NULL),
(4, 6, 'vi', 'Nokia N97 mini Navi', '<ul class=\"item_list\" style=\"padding-left: 15px; margin: 0px;\">\r\n<li>Kiểu trượt cảm ứng s&agrave;nh điệu</li>\r\n<li>Camera 5 MP, camera phụ thực hiện videocall</li>\r\n<li>Bộ nhớ 32 GB, RAM 128 MB</li>\r\n<li>Chức năng định vị GPS</li>\r\n<li>Chức năng Out-Tivi, jack tai nghe 3.5mm</li>\r\n<li>Pocket Office (Word, Excel, PowerPoint, PDF viewer)</li>\r\n<li>Chỉnh sửa h&igrave;nh ảnh v&agrave; Video</li>\r\n<li>Flash Lite 3</li>\r\n<li>Kết nối 3G, Wifi, Bluetooth </li>\r\n</ul>', NULL),
