(471, 473, 'vi', 'Samsung RF710', '<h2 data-field=\"sapo\" style=\"margin: 0px 0px 20px; padding: 0px; list-style: none; border: 0px; font-size: 15px; outline: none; color: rgb(82, 80, 80); font-weight: bold; font-family: Tahoma;\">Những sáng kiến mà có lẽ chỉ có các game thủ Việt mới nghĩ ra được là đây.</h2><div id=\"admzonek9yy7w7l\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; font-size: 12px; outline: none; color: rgb(51, 51, 51); font-family: Tahoma;\"></div><ul class=\"relate-news\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; list-style: none; border: 0px; font-size: 12px; outline: none; color: rgb(51, 51, 51); font-family: Tahoma;\"></ul><div data-check-position=\"gamek_detail_position_start\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; font-size: 12px; outline: none; color: rgb(51, 51, 51); font-family: Tahoma;\"></div><div class=\"rightdetail_content\" data-field=\"body\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 17px; line-height: 23px; font-family: &quot;Times New Roman&quot;; outline: none; color: rgb(51, 51, 51);\"><p style=\"margin-bottom: 0px; padding: 0px 0px 20px; list-style: none; border: 0px; outline: none;\">Người Việt luôn rất giỏi sáng tạo, và&nbsp;đặc biệt, các game thủ Việt thì càng là bậc thầy của việc \"vượt khó\". Nếu như thời xưa, các phần mềm auto chưa ra&nbsp;đời thì riêng màn \"cắm chuột\"&nbsp;để train MU Online&nbsp;đã trở thành bất hủ thì sau này, không&nbsp;ít lần chúng ta lại&nbsp;được một phen nể phục với những sáng kiến không có giới hạn tới từ các game thủ Việt,&nbsp;điển hình như các trường hợp dưới&nbsp;đây.</p><p style=\"margin-bottom: 0px; padding: 0px 0px 20px; list-style: none; border: 0px; outline: none;\"><b style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; outline: none;\">Máy tính \"độ\" tivi cổ&nbsp;điển</b></p><p style=\"margin-bottom: 0px; padding: 0px 0px 20px; list-style: none; border: 0px; outline: none;\">Dùng màn hình TV cổ&nbsp;điển&nbsp;để làm máy tính -&nbsp;điều này có lẽ không phải ai cũng nghĩ tới mà ngay cả nghĩ tới thì cũng chưa chắc&nbsp;đã làm ra&nbsp;được.&nbsp;Ấy thế nhưng, cuối cùng thì \"sản phẩm\" này cũng ra&nbsp;đời và trên hết, nó&nbsp;được tạo ra bởi một người Việt.</p><div class=\"VCSortableInPreviewMode\" type=\"Photo\" style=\"margin: 0px 0px 10px; padding: 0px; list-style: none; border: 0px; outline: none; font-style: italic; text-align: center;\"><div style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; outline: none;\"><a href=\"https://gamek.mediacdn.vn/133514250583805952/2021/6/28/photo-1-1624883811889204583143.jpg\" data-fancybox-group=\"img-lightbox\" title=\"Tivi thì cổ nhưng Windows lại xịn nhé\" target=\"_blank\" class=\"detail-img-lightbox\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; outline: none;\"><img src=\"https://gamek.mediacdn.vn/thumb_w/640/133514250583805952/2021/6/28/photo-1-1624883811889204583143.jpg\" id=\"img_333949707083911168\" w=\"690\" h=\"518\" alt=\"Máy tính độ tivi cổ và những màn sáng tạo đầy bất ngờ, ngẫu hứng khiến ai cũng phải nể phục của các game thủ Việt - Ảnh 1.\" title=\"Máy tính độ tivi cổ và những màn sáng tạo đầy bất ngờ, ngẫu hứng khiến ai cũng phải nể phục của các game thủ Việt - Ảnh 1.\" rel=\"lightbox\" photoid=\"333949707083911168\" type=\"photo\" data-original=\"https://gamek.mediacdn.vn/133514250583805952/2021/6/28/photo-1-1624883811889204583143.jpg\" width=\"\" height=\"\" class=\"lightbox-content\" style=\"margin: 0px; padding: 0px; list-style: none; font-size: 0px; outline: none; color: transparent; max-width: 100%;\"></a></div><div class=\"PhotoCMS_Caption\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; outline: none; min-height: 0px;\"><p data-placeholder=\"[nhập chú thích]\" class=\"\" style=\"margin-top: 10px; margin-bottom: 0px